    [SerializeField]
    Transform block;
    [SerializeField]
    private GameObject floorBlock;
    [SerializeField]
    private GameObject wallBlock;

    [SerializeField]
    Transform[] EnemyList;
    [SerializeField]
    private GameObject[] Enemy;
    [SerializeField]
    private GameObject[] EnemyM;
    [SerializeField]
    private Vector2[] EnemyPos;
    [SerializeField]
    private Vector2[] EnemyDefaultPos;

    [SerializeField]
    private float[] EnemyY;
    [SerializeField]
    private int[] EnemyPositionX;
    [SerializeField]
    private int[] EnemyPositionY;

    [SerializeField]
    private GameObject Player;

    private int EnemyNumber;
    private Vector2 pos;

    public int PlayerPositionX = 0; //二次元配列のプレイヤーの横
    public int PlayerPositionY = 0; //二次元配列のプレイヤーの縦

    EnemyController EnemyScript;

    void Awake()
    {
        for (int i = 0; i < stageArray.GetLength(0); i++)
        {
            for (int j = 0; j < stageArray.GetLength(1); j++)
            {
                if (stageArray[i, j] == 1)
                {
                    Instantiate(floorBlock, new Vector3(j, i, 0), Quaternion.identity,block);
                }

                if (stageArray[i, j] == 5)
                {
                    Instantiate(Player, new Vector3(j, i, 0), Quaternion.identity);
                }

                if (stageArray[i, j] == 6)
                {
                    Instantiate(Enemy[0], new Vector3(j, i + EnemyY[0], 0), Quaternion.identity, EnemyList[0]);                  

                }
                if (stageArray[i, j] == 7)
                {
                    Instantiate(Enemy[1], new Vector3(j, i + EnemyY[1], 0), Quaternion.identity, EnemyList[0]);

                }
                if (stageArray[i, j] == 9)
                {
                    Instantiate(Enemy[2], new Vector3(j, i + EnemyY[2], 0), Quaternion.identity);
                }
            }
        }

        //-----------二次元配列からプレイヤーの位置取得--------
        for (int i = 0; i < stageArray.GetLength(0); i++)
        {
            for (int j = 0; j < stageArray.GetLength(1); j++)
            {
                if (stageArray[i, j] == 5)
                {
                    PlayerPositionX = j;
                    PlayerPositionY = i;
                }
            }
        }
    }

    void Start()
    {
        Player = GameObject.FindGameObjectWithTag("Player");
        GameObject[] EnemyM = GameObject.FindGameObjectsWithTag("Enemy");

        for (int i = 0; i < EnemyM.Length; i++)
        {
            EnemyDefaultPos[i] = EnemyM[i].transform.position;                      
        }

    }

    private void Update()
    {
        PlayerPosition();

        EnemyPosition();
        
    }

    private void PlayerPosition()
    {
        pos = Player.transform.position;

        PlayerPositionX = Mathf.FloorToInt(pos.x);
        PlayerPositionY = Mathf.FloorToInt(pos.y);

    }
    private void UpdateEnemyPosition()
    {
       
    }
        
    private void EnemyPosition()
    {
        EnemyM = GameObject.FindGameObjectsWithTag("Soft");
        EnemyM = GameObject.FindGameObjectsWithTag("Normal");
        EnemyM = GameObject.FindGameObjectsWithTag("Hard");

        for (int i = 0; i < EnemyM.Length; i++)
        {
            EnemyPos[i] = EnemyM[i].transform.position;
            EnemyPositionX[i] = Mathf.FloorToInt(EnemyPos[i].x);
            EnemyPositionY[i] = Mathf.FloorToInt(EnemyPos[i].y);

            EnemyScript = EnemyM[i].GetComponent<EnemyController>();

            //stageArray[EnemyPositionY[i], EnemyPositionX[i]] = 0;
            //stageArray[EnemyPositionY[i], EnemyPositionX[i] + EnemyScript.MoveX] = 6;
           
            if (EnemyScript.num == 1) //右向き
            {
                //１つ右が行けないエリアだった場合反転
                if (stageArray[EnemyPositionY[i], EnemyPositionX[i] + 1] == 4 || stageArray[EnemyPositionY[i] - 1, EnemyPositionX[i] + 1] == 4)
                {                   
                    EnemyScript._IsTracking = false; //追跡オフ
                    EnemyScript._IsReturn = true;　//元の位置に戻る
                    EnemyScript._Retrcking = true; //反転
                }

                //１つ右が壁だった場合ジャンプ
                if (stageArray[EnemyPositionY[i], EnemyPositionX[i] + 1] == 3 && stageArray[EnemyPositionY[i], EnemyPositionX[i] + 2] == 2)
                {
                    EnemyScript._IsJump = true;
                }

                //１つ右が敵だった場合待機
                if (stageArray[EnemyPositionY[i], EnemyPositionX[i] + 1] == 6 || stageArray[EnemyPositionY[i] - 1, EnemyPositionX[i] + 1] == 6)
                {
                    EnemyScript._IsTrackingWait = true;
                    EnemyScript.anime = 4;
                }
                if (EnemyScript._IsTrackingWait == true)
                {
                    if (stageArray[EnemyPositionY[i], EnemyPositionX[i] + 1] == 0 || stageArray[EnemyPositionY[i] - 1, EnemyPositionX[i] + 1] == 0)
                    {
                        EnemyScript._IsTrackingWait = false;
                        EnemyScript.anime = 2;
                    }
                }
            }

            if (EnemyScript.num == -1) //左向き
            {               
                //１つ左が行けないエリアだった場合反転
                if (stageArray[EnemyPositionY[i], EnemyPositionX[i] - 1] == 4 || stageArray[EnemyPositionY[i] - 1, EnemyPositionX[i] - 1] == 4)
                {
                    EnemyScript._IsTracking = false; //追跡オフ
                    EnemyScript._IsReturn = true;  //元の位置に戻る
                    EnemyScript._Retrcking = false; //反転
                }

                //１つ左が壁だった場合ジャンプ
                if (stageArray[EnemyPositionY[i], EnemyPositionX[i] - 1] == 3 && stageArray[EnemyPositionY[i], EnemyPositionX[i] - 2] == 2)
                {
                    EnemyScript._IsJump = true;
                }

                //１つ左が敵だった場合待機
                if (stageArray[EnemyPositionY[i], EnemyPositionX[i] - 2] == 6 || stageArray[EnemyPositionY[i] - 1, EnemyPositionX[i] - 2] == 6)
                {
                    EnemyScript._IsTrackingWait = true;
                    EnemyScript.anime = 4;
                }

                if (EnemyScript._IsTrackingWait == true)
                {
                    if (stageArray[EnemyPositionY[i], EnemyPositionX[i] - 1] == 0 || stageArray[EnemyPositionY[i] - 1, EnemyPositionX[i] - 1] == 0)
                    {
                        EnemyScript._IsTrackingWait = false;
                        EnemyScript.anime = 2;
                    }
                }
            }
        }
    }
}
